import { Container } from "react-bootstrap";
import BaseLayout from "../BaseLayout";
import FoldersHeaderBar from "../../shared/Cudzoziemcy/FoldersHeaderBar";
import FoldersMainContent from "../../shared/Cudzoziemcy/FoldersMainContent";
import { useRouter } from "next/router";

class FoldersPageLayout extends Component {
  constructor(props) {
    super(props);
    this.handleChange = this.handleChange.bind(this);
    this.state = { origin: "" };
    const router = useRouter();
    const items = router.asPath.split("/");
  }

  handleChange(e) {
    this.setState({ origin: e.target.value });
  }

  render() {
    const choice = this.state.origin;
    return (
      <BaseLayout title={props.title}>
        <Container className="wrapper">
          <FoldersHeaderBar crumbs={items} />
          <FoldersMainContent content={choice} />
        </Container>
      </BaseLayout>
    );
  }
}

export default FoldersPageLayout;
